import React, { useState } from 'react'; // Import useState
import './loginstyle.css';

const NikeSignInPage = () => {
  const [email, setEmail] = useState(''); // Default state as empty string
  const [password, setPassword] = useState(''); // Default state as empty string

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle sign-in logic here
    console.log('Email:', email, 'Password:', password);
  };

  return (
    <div className="nikeLoginContainer">
      <div className="nikeSignInCard">
        {/* Nike Logo */}
        <div className="nikeLogoContainer">
  <img className="nikeLogo" src="/media/" alt="Nike Logo" />
</div>

        {/* Sign In Form */}
        <form onSubmit={handleSubmit} className="nikeForm">
          <div>
            <h2 className="nikeSignInTitle">
              IT'S BETTER AS<br />A MEMBER
            </h2>
          </div>

          <div className="nikeInputGroup">
            <input
              type="email"
              placeholder="Email address"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              className="nikeInputField"
              required
            />
            <input
              type="password"
              placeholder="Password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              className="nikeInputField"
              required
            />
          </div>

          <div className="nikeRememberForgot">
            <label className="nikeCheckbox">
              <input type="checkbox" className="nikeCheckboxInput" />
              Keep me signed in
            </label>
            <a href="#" className="nikeForgotPassword">
              Forgot password?
            </a>
          </div>

          <button
            type="submit"
            className="nikeSubmitButton"
          >
            SIGN IN
          </button>

          <div className="nikeSignUpText">
            Not a Member?{' '}
            <a href="#" className="nikeSignUpLink">
              Join Us
            </a>
          </div>
        </form>
      </div>
    </div>
  );
};

export default NikeSignInPage;
